/*
* constructors
* */
class Element {
    constructor(el) {
        this.el = document.querySelector(el);
    }

    show() {
        this.el.classList.add('show');
    }

    hide() {
        this.el.classList.remove('show');
    }

    clear() {
        this.el.innerHTML = '';
    }

    set inner_html(html) {
        this.el.innerHTML = html;
    }

    set style_set(option){
        this.el.style = option
    }

    set onclick_set(f){
        this.el.setAttribute('onclick', f);
    }

    set color_set(color) {
        this.el.style.color = color;
    }

    set fill_set(color) {
        this.el.style.fill = color;
    }

    set background_set(color) {
        this.el.style.background = color;
    }

    set append_html(html) {
        this.el.insertAdjacentHTML('beforeend', `${html}`)
    }
}

const lock_slide = new Element('.js_phone_lock');
const apps_container = new Element('.js_apps');
const header_time = new Element('.js_header_time');
const header_icons = new Element('.js_header_icons_svg');
const button_bottom = new Element('.js_button_bottom');
const button_bottom_line = new Element('.js_button_bottom_line');
const button_back_icon = new Element('.js_button_back_icon');
const button_back_icon_svg = new Element('.js_button_back_icon_svg');
const button_back_text = new Element('.js_button_back_text');
const button_back_text_span = new Element('.js_button_back_text_span');


/*
* secondary functions
* */
function clock() {
    let d = new Date(),
        month = d.getMonth(),
        day = d.getDate(),
        days = d.getDay(),
        hours = d.getHours(),
        minutes = d.getMinutes(),

        daysName = ['Воскресенье', 'Понедельник', 'Вторник', 'Среда', 'Четверг', 'Пятница', 'Суббота'],
        monthName = ['Января', 'Февраля', 'Марта', 'Апреля', 'Мая', 'Июля', 'Июня', 'Августа', 'Сентября', 'Октября', 'Ноября', 'Декабря'],

        daysN = daysName[days],
        monthN = monthName[month];

    if (hours <= 9) hours = "0" + hours;
    if (minutes <= 9) minutes = "0" + minutes;

    for (let time of phone.times) time.innerHTML = `${hours}:${minutes}`;
    phone.date.innerHTML = `${daysN}, ${day} ${monthN}`;

    setTimeout("clock()", 1000);
}

function app_open(app_html) {
    apps_container.clear();
    apps_container.show();
    apps_container.append_html = app_html
}

function app_close() {
    sub_elements_color_set(1);
    button_back_icon.style_set = '';
    button_back_icon.hide();
    button_back_text.hide();
    apps_container.clear();
    apps_container.hide();
}

function sub_elements_color_set(type) {
    // black
    if (type === 0) {
        header_time.color_set = '#000000';
        header_icons.fill_set = '#000000';
        button_back_icon_svg.fill_set = '#000000';
        button_bottom_line.background_set = '#000000';
    }
    // white
    if (type === 1) {
        header_time.color_set = '#ffffff';
        header_icons.fill_set = '#ffffff';
        button_back_icon_svg.fill_set = '#ffffff';
        button_bottom_line.background_set = '#ffffff';
    }
}

function header_icon_sleep_visibility() {
    phone.sleep
        ? phone.header_icons.classList.add('sleep')
        : phone.header_icons.classList.remove('sleep')
}

function phone_scheme_set() {
    phone.dark_scheme
        ? phone.wrap.classList.add('dark')
        : phone.wrap.classList.remove('dark')
}

function wallpapers_set() {
    let $wallpaper_images = document.querySelectorAll('.js_wallpaper_image');
    for (let el of $wallpaper_images) el.style.backgroundImage = `url("img/wall/${phone.selected_wallpaper}.jpg")`
}


/*
* html get
* */
function button_back_svg_get() {
    return `
        <svg width="8" height="13" viewBox="0 0 8 13" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path fill-rule="evenodd" clip-rule="evenodd" d="M8 11.6295L6.64174 13L0.199999 6.5L6.64174 1.18743e-07L8 1.37054L2.91652 6.5L8 11.6295Z" fill="white"/>
        </svg>

    `
}


/*
* handlers
* */
function phone_slide_lock_click_handler() {
    phone.lock_icon.querySelector('svg').style.top = "-3px";

    setTimeout(function () {
        lock_slide.hide();
    }, 200);
    setTimeout(function () {
        phone.lock_icon.querySelector('svg').style.top = "0";
    }, 400);
}

function phone_btn_lock_handler() {
    sub_elements_color_set(1);
    lock_slide.show();
    button_bottom.hide();
    button_back_icon.hide();
    button_back_text.hide();
    setTimeout(() => {
        apps_container.clear();
        apps_container.hide();
    }, 300)
}

function phone_btn_bottom_handler() {
    button_bottom.hide();
    app_close();
}


/*
* App setting
* */
function radio_active_check(is_true) {
    if (is_true) return 'active'
}

function setting_radio_switch_handler(type, $this) {
    if ($this.classList.contains('active')) {
        $this.classList.remove('active');

        if (type === 0) {
            phone.sleep = false;
            header_icon_sleep_visibility();
            server_sleep_switch_handlers(phone.sleep)
        }

        if(type === 1){
            phone.sounds = false;
            server_sounds_switch_handlers(phone.sounds)
        }

        if(type === 2){
            phone.dark_scheme = false;
            phone_scheme_set(phone.dark_scheme);
            sub_elements_color_set(0);
            server_dark_scheme_switch_handlers(phone.dark_scheme);
        }


    } else {
        $this.classList.add('active');

        if (type === 0) {
            phone.sleep = true;
            header_icon_sleep_visibility();
            server_sleep_switch_handlers(phone.sleep)
        }

        if(type === 1){
            phone.sounds = true;
            server_sounds_switch_handlers(phone.sounds)
        }

        if(type === 2){
            phone.dark_scheme = true;
            phone_scheme_set(phone.dark_scheme);
            sub_elements_color_set(1);
            server_dark_scheme_switch_handlers(phone.dark_scheme);
        }
    }
}

function setting_wallpaper_html_get() {
    return `
        <div class="app setting__wallpapers">
            <div class="title">Выбор обоев</div>
            <div class="wallpapers-container scroll js_wallpapers"></div>
        </div>
    `
}

function setting_wallpaper_img_append() {
    for(let i = 0; i < phone.wallpapers.length; i++){
        document.querySelector('.js_wallpapers')
            .insertAdjacentHTML('beforeend',`
                <a class="item js_wallpapers_item" data-index="${i}">
                    <img  src="${phone.wallpapers[i]}" alt="">
                </a>
            `)
    }
}

function app_setting_wallpaper_selection() {
    let $wallpaper_items = document.querySelectorAll('.js_wallpapers_item');
    let $this_item = document.querySelector(`.js_wallpapers_item[data-index='${phone.selected_wallpaper}']`);
    for (let el of $wallpaper_items) el.classList.remove('selected');
    $this_item.classList.add('selected');

}

function app_setting_wallpaper_select_handler() {
    let $wallpaper_items = document.querySelectorAll('.js_wallpapers_item');

    $wallpaper_items.forEach(item => {
        item.addEventListener('click', () => {
            phone.selected_wallpaper = item.dataset.index;
            app_setting_wallpaper_selection();
            server_wallpaper_set_handler(item.dataset.index);
            wallpapers_set();
        })
    })
}

function app_setting_wallpaper_open(){
    app_open(setting_wallpaper_html_get());
    setting_wallpaper_img_append();
    app_setting_wallpaper_select_handler();
    app_setting_wallpaper_selection();


    button_back_icon.style_set = 'top: 52px; left: 34px';
    button_back_icon.show();
    button_back_icon.onclick_set = 'app_setting_open()';
    button_back_icon_svg.fill_set = '#007AFF';
}

