function news_recent_html_get() {
    return `
        <div class="app weazel-news-view">
            <div class="header">
                ${phone.dark_scheme ? news_logo_white_svg_get() : news_logo_black_svg_get()}
                <a onclick="app_news_add_new_open()">Подать объявление</a>
            </div>
            <div class="container scroll js_news_recent_container"></div>
        </div>
    `
}

function news_control_html_get() {
    return `
        <div class="app weazel-news-control">
            <div class="header">
                ${phone.dark_scheme ? news_logo_white_svg_get() : news_logo_black_svg_get()}
                <a onclick="app_news_add_new_open()">Подать объявление</a>
            </div>
            
            <p class="title">Список новостей <br />для редактирования</p>
            
            <div class="container scroll js_news_control_container">
                
            </div>
        </div>
    `
}

function news_add_html_get() {
    return `
        <div class="app weazel-news-add">
            <div class="header">
                ${news_logo_white_svg_get()}
                <a onclick="app_news_open()">
                    ${button_back_svg_get()}
                    Назад
                </a>
            </div> 
            <p class="title">Создать объявление</p>
            <span class="calc">1 символ = $30</span>
            <div class="textarea">
                <textarea oninput="news_textarea_input_handler(this.value)" maxlength="60" class="news-text scroll-hide js_news_textarea" placeholder="Написать сообщение..."></textarea>
                <div class="text-calc">
                    <span class="js_news_textarea_calc">0</span>
                    <span> / 60</span>
                </div>
            </div>
            <a class="send-news" onclick="news_public_btn_handler()">Опубликовать</a>
            <p class="news-cost">Цена к оплате: <span class="js_news_cost">$0</span></p>
            <a class="back-to-news" onclick="app_news_recent_open()">Список объявлений</a>
        </div>
    `
}

