function news_html_get(){
    return `
        <div class="app weazel-news">
            ${news_logo_white_svg_get()}            

            <a class="add-news js-add-news" onclick="app_news_add_new_open()">Подать объявление</a>
            
            <a class="view-recent-news js-show-recent-news" onclick="app_news_recent_open()">Смотреть последние объявления</a>
            
            ${phone.is_admin ? news_button_control_html_get() : ''}
            
            ${news_man_svg_get()}
        </div>
    `
}

function news_textarea_input_handler(value) {
    let sum = document.querySelector('.js_news_cost');

    document.querySelector('.js_news_textarea_calc').innerText = value.length;
    if(sum) sum.innerText = outLifeMoney(value.length * 30) ;
}

function news_public_btn_handler() {
    let textarea = document.querySelector('.js_news_textarea');

    if(textarea.value.length !== 0){
        server_news_public_new_handler(textarea.value, textarea.value.length);
        app_open(news_html_get());
    }
}

function news_edit_public_btn_handler() {
    let textarea = document.querySelector('.js_news_textarea');

    if(textarea.value.length !== 0){
        server_news_edit_public_new_handler(textarea.value, textarea.value.length);
        app_open(news_html_get());
    }
}

function news_control_append_news() {
    let $news_control_container = document.querySelector('.js_news_control_container');
    for (let i = 0; i < phone.not_edited_news.length; i++){
        $news_control_container.insertAdjacentHTML('beforeend', `
            <div class="item">
                <div class="text">
                    <p class="name">${phone.not_edited_news[i].name}</p>
                    <p class="text">${phone.not_edited_news[i].text}</p>
                    <div>
                        <p class="number">${phone.not_edited_news[i].number}</p>
                        <p class="time">${outLifeMoney(phone.not_edited_news[i].text.length * 30 * 0.2)}</p>
                    </div>
                </div>
                <a class="button" onclick="app_news_edit_open(${i})">Редактировать</a>
            </div>
        `)
    }
}

function app_news_edit_open(index) {
    sub_elements_color_set(1);
    app_open(news_edit_html_get());

    document.querySelector('.js_news_textarea')
        .value = phone.not_edited_news[index].text;
    document.querySelector('.js_news_textarea_calc')
        .innerText = phone.not_edited_news[index].text.length;
}

function app_news_control_open() {
    phone.dark_scheme ? sub_elements_color_set(1) : sub_elements_color_set(0);

    app_open(news_control_html_get());
    news_control_append_news();
}

function news_recent_append_news() {
    let $news_recent_container =  document.querySelector('.js_news_recent_container');

    for (let i = 0; i < phone.recent_news.length; i++){
        $news_recent_container.insertAdjacentHTML('beforeend', `
            <div class="item">
                <p class="text">
                    ${phone.recent_news[i].text} 
                    <span class="number">${phone.recent_news[i].number}</span>
                </p>
                <div class="buttons">
                    <a onclick="callTo(${phone.recent_news[i].number})" class="button-call">
                        ${news_recent_phone_svg_get()}
                    </a>
                    <a onclick="sendSmsTo(${phone.recent_news[i].number})" class="button-send-sms">
                        ${news_recent_message_svg_get()}
                    </a>
                </div>
            </div>
        `);
    }
}

function app_news_recent_open() {
    phone.dark_scheme ? sub_elements_color_set(1) : sub_elements_color_set(0);
    app_open(news_recent_html_get());
    news_recent_append_news();
}

function app_news_add_new_open() {
    app_open(news_add_html_get());
}

function app_news_open(){
    app_open(news_html_get());
    button_bottom.show();
    sub_elements_color_set(1)
}


