function bank_transition_html_get() {
    return `
        <div class="app pay-transition">
            <div class="icon">${bank_logo_svg_get()}</div>
            <div class="spin-circle transition-img js_transition_img"></div>
            <span>Транзакция в обработке</span>
            <a class="js_transition_btn" onclick="app_bank_open()" >на главную</a>
        </div>
    `
}

function bank_html_get() {
    return`
        <div class="app bank js-bank">
            <div class="icon">
                ${bank_logo_svg_get()}
            </div>
            <span>Total Balance</span>
            <p class="bank-balance">${outLifeMoney(phone.bank_balance)}</p>
            <a class="pay-house" onclick="bank_pay_block_show_handler(0)">
                Оплатить<br /> дом
            </a>
            <a class="pay-rent" onclick="bank_pay_block_show_handler(1)">
                Оплатить<br /> квартиру
            </a>
            <a class="pay-phone" onclick="bank_pay_block_show_handler(2)">
                Пополнить<br /> телефон
            </a>
            <a class="pay-biz" onclick="bank_pay_block_show_handler(3)">
                Оплатить<br /> бизнес
            </a>
            
            <div class="pay-block js_bank_pay_block">
                <a class="pay-block-cancel js-pay-cancel" onclick="bank_pay_block_hide_handler()">Отмена</a>
                <span class="pay-block-type js_bank_pay_type"></span>
                <input class="pay-block-amount js_bank_pay_input" type="text" oninput="digitsOnly(this)">
                <span class="pay-block-fee">Ваша комиссия - 10%</span>
                <a class="pay-block-button js_bank_pay_button" oninput="bank_transition_btn_handler(0)">Оплатить</a>
            </div>
            
            <div class="js_bank_pay_transition"></div>
        </div>
    `
}

function bank_pay_block_hide_handler(){
    let $pay_block = document.querySelector('.js_bank_pay_block');
    $pay_block.classList.remove('show');

}

function bank_pay_block_show_handler(index) {
    let text = '',
        $pay_block = document.querySelector('.js_bank_pay_block'),
        $pay_type = document.querySelector('.js_bank_pay_type'),
        $bank_pay_button = document.querySelector('.js_bank_pay_button');

    if(index === 0) text = 'Оплатить дом';
    if(index === 1) text = 'Оплатить квартиру';
    if(index === 2) text = 'Пополнить телефон';
    if(index === 3) text = 'Оплатить бизнес';

    $pay_block.classList.add('show');
    $pay_type.innerText = text;
    $bank_pay_button.setAttribute('onclick', `bank_transition_btn_handler(${index})`);
}

function bank_transition_btn_handler(index) {
    let $pay_input = document.querySelector('.js_bank_pay_input');

    if($pay_input.value.length !== 0){
        server_bank_pay(index, $pay_input.value);
        bank_pay_block_hide_handler();
        app_bank_transition_open()
    } else {
        $pay_input.focus()
    }
}

function app_bank_transition_open(){
    app_open(bank_transition_html_get());

    setTimeout(() => {
        let $transition_img = document.querySelector('.js_transition_img'),
            $transition_btn = document.querySelector('.js_transition_btn');

        $transition_img.classList.remove('spin-circle');
        $transition_img.classList.add('accept');
        $transition_btn.classList.add('show');
    }, 2000)
}

function app_bank_open() {
    button_bottom.show();
    button_bottom_line.background_set = '#fff';
    button_back_icon.show();
    button_back_icon.onclick_set = 'app_close()';
    app_open(bank_html_get())
}


/*
* App transport
* */
function transport_html_get() {
    return `
        <div class="app transport js-transport">
            <span class="hello">Добро пожаловать!</span>
            <p class="title">Сигнализация авто</p>
            <div class="container-transport js_transport_container scroll-hide"></div>
        </div>
    `
}

function transport_control_html_get(index) {
    return `
        <div class="app transport-events js-transport-events">
            <div class="header" style="background: url('img/transport/${phone.transport[index].imageId}.jpg')">
                <p class="text">Управление</p>
                <p class="name">${phone.transport[index].transportName}</p>
                <p class="plate">${phone.transport[index].transportPlate}</p>
            </div>
            <div class="buttons">
                <a onclick="server_transport_events_handler(0, ${index})">Открыть</a>
                <a onclick="server_transport_events_handler(1, ${index})">Завести двигатель</a>
                <a onclick="server_transport_events_handler(2, ${index})">Эвакуировать</a>
                <a onclick="server_transport_events_handler(3, ${index})">Найти авто</a>
            </div>
        </div>
    `
}



function transport_append_items() {
    let $transport_container =  document.querySelector('.js_transport_container');

    for (let i = 0; i < phone.transport.length; i++){
        $transport_container.insertAdjacentHTML('beforeend', `
            <a onclick="app_transport_car_open(${i})" class="item" style="background-image: url('img/transport/${phone.transport[i].imageId}.jpg')">
                <span class="name">${phone.transport[i].transportName}</span>
                <span class="plate">${phone.transport[i].transportPlate}</span>
                <span class="arrow">
                    <svg width="14" height="7" viewBox="0 0 14 7" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <path d="M0.6875 3.94199L11.198 3.94199L9.521 5.62549L10.4375 6.54199L13.6875 3.29199L10.4375 0.0419922L9.521 0.958492L11.198 2.64199L0.6875 2.64199L0.6875 3.94199Z" fill="white" fill-opacity="0.3"/>
                    </svg>
                </span>
            </a>
        `);
    }
}

function app_transport_car_open(index) {
    button_back_icon.onclick_set = 'app_transport_open()';
    app_open(transport_control_html_get(index))
}

function app_transport_open() {
    button_bottom.show();
    button_back_icon.show();
    button_back_icon.onclick_set = 'app_close()';
    phone.dark_scheme ? sub_elements_color_set(1) : sub_elements_color_set(0);
    app_open(transport_html_get());
    transport_append_items();
}







