function phone_init(name, number, sleep, sounds, dark_scheme, selected_wallpaper, is_admin, recent_news, not_edited_news, bank_balance, transport) {
    phone.player_name = name;
    phone.player_number = number;
    phone.sleep = sleep;
    phone.sounds = sounds;
    phone.dark_scheme = dark_scheme;
    phone.selected_wallpaper = selected_wallpaper;
    phone.is_admin = is_admin;
    phone.recent_news = recent_news;
    phone.not_edited_news = not_edited_news;
    phone.bank_balance = bank_balance;
    phone.transport = transport;

    clock();
    header_icon_sleep_visibility();
    phone_scheme_set();
    wallpapers_set(phone.selected_wallpaper)
}

